    false,nt"url": null,nt"notes": "Vector datasets of CWHR range maps are
    one component of California Wildlife Habitat Relationships (CWHR; http://www.dfg.ca.gov/biogeodata/cwhr/),
    a comprehensive information system and predictive model for California's wildlife.
    The CWHR System was developed to support habitat conservation and management, land
    use planning, impact assessment, education, and research involving terrestrial vertebrates
    in California. CWHR contains information on life history, management status, geographic
    distribution, and habitat relationships for 712 species of amphibians, reptiles,
    birds, and mammals known to occur regularly in the state. Range maps represent the
    maximum, current geographic extent of each species within California. They were
    originally delineated at a scale of 1:5,000,000 by species-level experts and have
    gradually been revised at a scale of 1:1,000,000. A list of available range maps
    including species code, species name, and range map revision history is available
    at http://nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=115517. For more information
    about CWHR, or to download a full set of CWHR GIS data, go to http://www.dfg.ca.gov/biogeodata/cwhr/.
    Links to .pdf files of each range map and each species life history account are
    available here: http://www.dfg.ca.gov/biogeodata/cwhr/cawildlife.aspx.",nt"owner_org":
